import './App.css';
import React,{useState,useEffect} from 'react';
import axios from 'axios';

function App() {
  function fetchData(){
   const reponse = axios.get('https://jsonplaceholder.typicode.com/users');
   console.log(reponse);

  }
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
